// DashboardTable.js
import React, { useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  TextField,
  IconButton
} from '@mui/material';
import AddCircleOutlineIcon from '@mui/icons-material/AddCircleOutline';
import Filelist from './Filelist'; // Now using Filelist component
import ActionBar from './ActionBar'; // Ensure this import path is correct
import '../styles/styles.css'; // Ensure this path is correct

const DashboardTable = () => {
  const [students, setStudents] = useState([
    {
      name: 'Claire Johnson',
      submissions: [],
      grade: '',
      comments: ''
    },
    // Add more students here as needed
  ]);

  // Handle new file submissions
  const handleNewSubmission = (newSubmission, index) => {
    const updatedStudents = [...students];
    updatedStudents[index].submissions = [
      ...updatedStudents[index].submissions,
      newSubmission
    ];
    setStudents(updatedStudents);
  };

  // Handle adding new rows for new students
  const addNewRow = () => {
    setStudents([...students, { name: '', submissions: [], grade: '', comments: '' }]);
  };

  // Handle audio recording submission
  const handleAddAudio = (index) => {
    const fileName = prompt("Enter a name for the audio recording:");
    const dateStr = prompt("Enter the date for the audio recording (YYYY-MM-DD):");

    const newSubmission = {
      fileName: fileName || 'Unnamed Audio',
      submittedOn: dateStr ? new Date(dateStr) : new Date(),
    };

    handleNewSubmission(newSubmission, index);
  };

  return (
    <Paper>
      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
              <TableCell>Submission</TableCell>
              <TableCell>Grade</TableCell>
              <TableCell>Comments</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {students.map((student, index) => (
              <React.Fragment key={index}>
                <TableRow>
                  <TableCell>
                    <TextField
                      fullWidth
                      value={student.name}
                      onChange={(e) => {
                        const updatedStudents = [...students];
                        updatedStudents[index].name = e.target.value;
                        setStudents(updatedStudents);
                      }}
                      placeholder="Enter name"
                    />
                  </TableCell>
                  <TableCell colSpan={4} style={{ paddingBottom: 0, paddingTop: 0 }}>
                    <Filelist
                      submissions={student.submissions}
                      onAddAudio={() => handleAddAudio(index)}
                    />
                  </TableCell>
                </TableRow>
                <TableRow>
                  <TableCell style={{ paddingTop: 0, paddingBottom: 0 }}>
                    <TextField
                      fullWidth
                      value={student.grade}
                      onChange={(e) => {
                        const updatedStudents = [...students];
                        updatedStudents[index].grade = e.target.value;
                        setStudents(updatedStudents);
                      }}
                      placeholder="Enter grade"
                    />
                  </TableCell>
                  <TableCell colSpan={4} style={{ paddingTop: 0, paddingBottom: 0 }}>
                    <TextField
                      fullWidth
                      value={student.comments}
                      onChange={(e) => {
                        const updatedStudents = [...students];
                        updatedStudents[index].comments = e.target.value;
                        setStudents(updatedStudents);
                      }}
                      placeholder="Enter comments"
                    />
                  </TableCell>
                </TableRow>
                <TableRow>
                  <TableCell colSpan={5} style={{ borderBottom: '1px solid #d3d3d3', padding: '4px 0' }}>
                    {/* Placeholder for action bar if needed */}
                    <ActionBar />
                  </TableCell>
                </TableRow>
                {index < students.length - 1 && (
                  <TableRow>
                    <TableCell colSpan={5} style={{ padding: '8px 0', borderBottom: 'none' }}>
                      {/* Divider */}
                    </TableCell>
                  </TableRow>
                )}
              </React.Fragment>
            ))}
            <TableRow>
              <TableCell colSpan={5} style={{ textAlign: 'center' }}>
                <IconButton onClick={addNewRow}>
                  <AddCircleOutlineIcon />
                </IconButton>
              </TableCell>
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
};

export default DashboardTable;
